INSERT INTO `wp_posts` VALUES (7,1,'2019-08-03 14:57:04','2019-08-03 14:57:04','','[:es]Inicio[:en]Home[:]','','publish','closed','closed','','inicio','','','2020-05-18 09:32:57','2020-05-18 14:32:57','',0,'http://www.perubroker.com.pe/?p=7',1,'nav_menu_item','',0),(9,1,'2019-08-03 14:57:04','2019-08-03 14:57:04','','[:es]Nosotros[:en]About[:]','','publish','closed','closed','','nosotros','','','2020-05-18 09:32:57','2020-05-18 14:32:57','',0,'http://www.perubroker.com.pe/?p=9',2,'nav_menu_item','',0),(12,1,'2019-08-03 14:57:04','2019-08-03 14:57:04','','[:es]Informes y datos[:en]Reports[:]','','publish','closed','closed','','reportes','','','2020-05-18 09:32:57','2020-05-18 14:32:57','',0,'http://www.perubroker.com.pe/?p=12',5,'nav_menu_item','',0),(13,1,'2019-08-03 14:57:04','2019-08-03 14:57:04','','[:es]Contctenos[:en]Contact[:]','','publish','closed','closed','','contacto','','','2020-05-18 09:32:57','2020-05-18 14:32:57','',0,'http://www.perubroker.com.pe/?p=13',6,'nav_menu_item','',0),(17,1,'2019-08-05 23:24:03','2019-08-05 23:24:03','[:es]Nuestra empresa empez su andadura en el mundo de las materias primas en 1949. En aquella poca los antiguos propietarios de la empresa realizaban operaciones de compraventa no slo con materias primas propiamente dichas sino tambin con productos transformados.\r\n<p align=\"justify\">Fue a partir de 1954 cuando lleg la especializacin en los sectores pesquero, agrario y de fletamentos.</p>\r\n<p align=\"justify\">Hoy, Peru Broker S.A. es una empresa de agenciamiento, representacin e intermediacin en los campos indicados anteriormente, y, gracias a nuestra experiencia y trabajo, podemos confirmar que somos una de las principales casas de corretaje para harina y aceite de pescado a nivel mundial.</p>\r\n<p align=\"justify\">Por nuestro conocimiento de las instituciones as como del empresariado peruano, nuestra actividad se despliega no solo a los rubros antes sealados, sino tambin a otros campos en los que contamos con buenos apoyos.</p>[:en]<span lang=\"EN-US\">Our company began its journey in the world of raw materials in 1949. At that time the former owners of the company carried out sales operations not only on raw materials as such but also on processed products.</span><u></u><u></u>\r\n\r\n<span lang=\"EN-US\">It was in 1954 when specialization lead us to the fishing, agricultural and chartering sectors.</span><u></u><u></u>\r\n\r\n<span lang=\"EN-US\">Today, Per Broker S.A. is an agency, representation and intermediation enterprise in the fields outlined above, and, thanks to our experience and work, we dare to say that we are, possibly, one of the leading brokerage houses for fishmeal and fish oil, worldwide.</span><u></u><u></u>\r\n\r\n<span lang=\"EN-US\">Due to the knowledge of our institutions, as well as of the Peruvian business community, our activity is deployed not only in the aforementioned items, but also in other fields where we count on good support</span>[:]','[:es]Resumen[:en]Summary[:]','','publish','closed','closed','','resumen','','','2020-05-18 09:54:56','2020-05-18 14:54:56','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=17',0,'broker_seccion','',0),(18,1,'2019-08-06 01:57:24','2019-08-06 01:57:24','[:es]PERU BROKER se fundo y constituyo en Lima, Per, en febrero del ao 1981, habiendo estado los accionistas y directivos relacionados con el comercio internacional de materias primas desde 1954.\r\n\r\nHoy en da actuamos como agentes representantes de un amplio abanico de compaas extranjeras y como comisionistas para una diversa gama de productos. Adems, hemos desarrollado a lo largo de los aos, un departamento gil y eficaz de shipping o agencia de fletamentos, facilitando as el proceso de ejecucin de embarques a nuestros principales clientes, ayudando con ello a reducir los costos de sobreestada que eventualmente pudieran surgir.\r\n\r\nIgualmente contamos con socios estratgicos en Europa, que cuentan con la misma experiencia a nivel global, manteniendo en cartera, clientes y proveedores tradicionales, as como nuevos, todos ellos de gran solvencia, envergadura y seriedad.\r\n\r\nEsta asociacin estratgica con otra empresa europea de reconocido prestigio en el sector, Hispatrade S.A. Madrid, Espaa, nos permite, por la diferencia de husos horarios el poder cubrir de manera adecuada y casi ininterrumpida cualquier demanda o solicitud de nuestros clientes en otros continentes.\r\n\r\nEn Per Broker S.A. somos conocedores de los requerimientos nutricionales y de las ventajas que proporciona el recurso peruano, principalmente la anchoveta peruana (Engraulis ringens) frente a otras especies para la fabricacin de piensos para la acuicultura, lechones y otras especies; todo ello sin olvidar el aspecto medioambiental en la fabricacin de harina y aceite, siendo Per un referente mundial durante los ltimos aos.[:en]<span lang=\"EN-US\">PER BROKER was founded and registered in Lima, Per, in February 1981, having been the shareholders and managers related to the international trade in raw materials since 1954.</span><u></u><u></u>\r\n\r\n<span lang=\"EN-US\">Todaywe are acting as agents, representing several foreign companies, and also as commission brokers for a diverse range of products. In addition, we have developed, over the years, an agile, efficient and professional department of \"shipping\" or chartering, thus facilitating to our customers, buyers and sellers, the process of the shipping and contract execution; hence also collaborating with them in reducing the freight costs and demurrage fees that could eventually arise.</span><u></u><u></u>\r\n\r\n<span lang=\"EN-US\">We also have strategic partners in Europe, who are having the same global experience as we do, and are always in the search of new highly solvent and serious suppliers and clients, apart from well maintaining the old ones.</span><u></u><u></u>\r\n\r\n<span lang=\"EN-US\">This strategic association with an European house of reknown prestige in the commodity sector,</span><span lang=\"EN-US\"></span>Hispatrade S.A. Madrid, Spain,<span lang=\"EN-US\">gives us a competitive edge, due to the world different time zones, allowing us to adequately cover any demand or request from our customers in other continents.</span><u></u><u></u>\r\n\r\n<span lang=\"EN-US\">Per Broker S.A. is aware of the nutritional requirements and the primacy or advantage provided by meal made from the Peruvian anchovy (Engraulis ringens) when compared to that made from other species and which is used in the manufacturing of feed for aquaculture, piglets and other species; all this without forgetting the environmental aspect in the production of meal and oil, that have lead Per to be a world benchmark in the last 15 years.</span>[:]','[:es]Historia[:en]History[:]','','publish','closed','closed','','historia','','','2020-05-18 09:54:10','2020-05-18 14:54:10','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=18',0,'broker_seccion','',0),(19,1,'2019-08-06 02:01:01','2019-08-06 02:01:01','[:es]<ul>\r\n 	<li>Ayudar a clientes y proveedores, proporcionndoles una informacin imparcial, basada en hechos, comentando adems las circunstancias y factores que influyen a tiempo real en el mercado.</li>\r\n</ul>\r\n<ul>\r\n 	<li>Servir a los clientes interesados en comprar  materias primas, consiguiendo los mejores precios disponibles de proveedores de primer orden, sean grandes o pequeos, pero de probada seriedad y alta calidad.</li>\r\n</ul>\r\n<ul>\r\n 	<li>Atender a clientes y proveedores con una ejecucin muy profesionalizada de los contratos, siendo la rapidez, la precisin, la informacin, y la capacidad de resolver problemas que pudieran surgir en los embarques, nuestras principales cualidades y cartas en el servicio.</li>\r\n</ul>\r\nEn resumen: <strong>Servir, ser tiles y ayudar</strong>con la mejor voluntad y experiencia tanto para clientes y proveedores, manteniendo como objetivo final la satisfaccin de ambas partes.[:en]<span lang=\"EN-US\"> Assisting customers and suppliers, providing them with unbiased, fact-based information, stressed by the circumstances and factors that are influencing the market in real time.</span><u></u><u></u>\r\n\r\n<span lang=\"EN-US\"> Serving buyers interested in purchasing raw materials, obtaining the best available prices from first-class suppliers, large or small, but of proven seriousness and performance.</span><u></u><u></u>\r\n\r\n<span lang=\"EN-US\"> Serving clients and suppliers by displaying a highly professionalized work and activity on the execution of contracts; focusing on the speed, accuracy, communication and our selfconfidence to solve problems which may eventually arise (fortunately not the rule but which may occur).</span><u></u><u></u>\r\n\r\n<span lang=\"EN-US\">In summary:<b>Serve</b>,<b>be useful</b>and<b>assist,</b>with the best of wills and expertise, to both buyers and sellers, endeavouring always to keep them both equally satisfied. This our final objective.</span>[:]','[:es]Objetivos[:en]Objetives[:]','','publish','closed','closed','','objetivos','','','2020-05-18 09:56:49','2020-05-18 14:56:49','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=19',0,'broker_seccion','',0),(20,1,'2019-08-06 02:03:18','2019-08-06 02:03:18','[:es]Estar en todo momento alerta y adaptarnos a las nuevas circunstancias y evolucin de los cambiantes mercados de las materias primas, teniendo en cuenta su dificultad y cumpliendo con nuestra funcin principal de apoyo y servicio tanto a proveedores como a clientes, labor que llevamos marcada desde los inicios de PERU BROKER SA, ahorrando tiempo en el proceso de compra y ejecucin, pero de igual manera evitando el desgaste de una relacin cuando puedan surgir eventuales problemas.\r\n\r\nCabe mencionar que estamos desde ya totalmente involucrados e integrados en las nuevas tendencias del consumo humano, tanto en los aceites de alto contenido de cidos grasos Omega-3, Omega-6, como en las harinas especiales procesadas mediante hidrlisis por fermentacin o digestin enzimtica, de ms alta disponibilidad proteica.[:en]<span lang=\"EN-US\">To keep being alert at all times and to keep adapting to the new circumstances and to the evolution of the changing markets in a changing world.<u></u><u></u></span>\r\n\r\n<span lang=\"EN-US\">To keep bearing in mind always the above rule and to keep carriyng out our main function of support and good service to both, buyers and sellers, and putting together their ideas.<u></u><u></u></span>\r\n\r\n<span lang=\"EN-US\">These are tasks that have guided us since the very beginnings of PER BROKER SA, and will keep guiding us in the future. At the end, these principles mean not only a save of time in the purchase and execution process for our customers, but also security and avoiding the wear and tear of a commercial relationship which is inherent to international trade.</span><u></u><u></u>\r\n\r\n<span lang=\"EN-US\">It is worth mentioning, also as a guideline for the future, that we will continue fully involved and integrated in the new trends in human consumption, both in fish oils with a high content of Omega-3 fatty acids, and in special meals processed by hydrolysis by fermentation or enzymatic digestion, of higher protein availability.</span>[:]','[:es]Idea de futuro[:en]Ideas for the future[:]','','publish','closed','closed','','idea-a-futuro','','','2020-05-18 09:58:12','2020-05-18 14:58:12','',0,'http://www.perubroker.com.pe/?post_type=broker_seccion&#038;p=20',0,'broker_seccion','',0),(22,1,'2019-08-06 02:52:24','2019-08-06 02:52:24','','historia_logo_perubroker','','inherit','open','closed','','historia_logo_perubroker','','','2019-08-06 02:52:24','2019-08-06 02:52:24','',17,'http://www.perubroker.com.pe/wp-content/uploads/2019/08/historia_logo_perubroker.png',0,'attachment','image/png',0),(28,1,'2019-08-06 04:23:34','2019-08-06 04:23:34','Lorem ipsum dolor sit amet, consectetur adipiscing elit. Donec leo nisi, finibus id 