nternational inport ans export consumer product open sea aerial view[:]','inherit','open','closed','','shipping-container-cargo-business-international-inport-ans-expor','','','2019-09-24 09:17:36','2019-09-24 14:17:36','',0,'http://www.perubroker.com.pe/wp-content/uploads/2019/09/747.jpg',0,'attachment','image/jpeg',0),(240,1,'2019-09-24 09:17:54','2019-09-24 14:17:54','','[:es]container terminal?Wharf, transport[:]','[:es]container terminal?Wharf, transport[:]','inherit','open','closed','','container-terminalwharf-transport-2','','','2019-09-24 09:17:54','2019-09-24 14:17:54','',0,'http://www.perubroker.com.pe/wp-content/uploads/2019/09/1194.jpg',0,'attachment','image/jpeg',0),(241,1,'2019-09-24 10:40:52','2019-09-24 15:40:52','','[:es]e3c0d2b806293826850a8b4cf2e66e84-original[:]','','inherit','open','closed','','e3c0d2b806293826850a8b4cf2e66e84-original','','','2019-09-24 10:41:42','2019-09-24 15:41:42','',31,'http://www.perubroker.com.pe/wp-content/uploads/2019/09/e3c0d2b806293826850a8b4cf2e66e84-original.jpg',0,'attachment','image/jpeg',0),(242,1,'2019-09-24 10:46:56','2019-09-24 15:46:56','[:es]<header><span class=\"submitted\" data-x=\"1574700321\">Creado el Lunes, 25 de Noviembre del 2019 11:45:21 am</span></header>\r\n<div class=\"field field-name-field-bajada field-type-text-long field-label-hidden\">\r\n<div class=\"field-items\">\r\n<div class=\"field-item even\">Las acusan de concertar precios para pagarles muy poco por tonelada de anchoveta</div>\r\n</div>\r\n<div>\r\n<p class=\"rtejustify\">Cientos de pescadores que laboran para los empresarios integrantes de la<strong>Asociacin de Armadores de Embarcaciones Industriales de Madera</strong>realizaron esta maana una movilizacin de protesta en Chimbote para exigir que las empresas pesqueras Exalmar, Hayduk, Copeinca, Austral, Centinela, TASA, entre otras, paguen un precio justo por cada tonelada de anchoveta que compran.</p>\r\n\r\n<!--more-->\r\n<p class=\"rtejustify\">Hombres de mar de Chimbote, Lambayeque, La Libertad y Piura participaron de esta protesta en la que portaban carteles con lemas como No a la concertacin de precios, SNP (Sociedad Nacional de Pesquera) no al monopolio.</p>\r\n<p class=\"rtejustify\">Las embarcaciones de madera, conocidas como Vikingas, son naves de 32 a 110m3 de capacidad de bodega. Estas pescan anchoveta, pero como no pueden procesarla directamente para elaborar harina de pescado, venden su pesca a las grandes empresas pesqueras.</p>\r\n<p class=\"rtejustify\">Walter Sipion, uno de los armadores presente en la protesta, seal que cuando se dio la ley de cuotas, en el 2008, les pagaban 280 dlares por tonelada de anchoveta, aunque cuando la calidad del recurso capturado no estaba en tan buenas condiciones, ahora que la situacin ha mejorado les pagan 200 y 210 dlares. Consider que un precio justo, ahora que han cado un poco las exportaciones, debera ser 240 dlares por tonelada.</p>\r\n<p class=\"rtejustify\">El armador agreg que antes las empresas pesqueras, como Tasa, Hayduk, Exalmar y las dems, cuando se iba a abrir la temporada de pesca hacan sus ofertas a las vikingas para comprarles su pesca de anchoveta, de tal modo que entre estas competan y los pescadores salan ganando, pero ahora eso cambi porque al parecer hay un acuerdo de precio entre las pesqueras.</p>\r\n<p class=\"rtejustify\">Hay una concertacin de la Sociedad (Nacional de Pesquera), acus Sipion, quien seal adems que su sector tiene el 20 % de la cuota de pesca de anchoveta y da ms empleo que las grandes empresas que pescan el 80 %.<strong><em>(EA/M- RSD Noticias)</em></strong></p>\r\n\r\n</div>\r\n</div>[:]','[:es]Cientos de pescadores del norte protestan contra las grandes empresas pesqueras[:]','','publish','open','open','','entrada-de-prueba','','','2019-11-28 14:44:31','2019-11-28 19:44:31','',0,'http://www.perubroker.com.pe/?p=242',0,'post','',0),(243,1,'2019-09-24 10:46:56','2019-09-24 15:46:56','[:es]Ut ac massa leo. Etiam ullamcorper diam id risus aliquam posuere