blica[:]','[:es]Pescadores exigen mayor pago por tonelada de anchoveta para jubilacin[:]','','inherit','closed','closed','','244-revision-v1','','','2019-11-28 14:41:53','2019-11-28 19:41:53','',244,'http://www.perubroker.com.pe/244-revision-v1/',0,'revision','',0),(331,1,'2019-11-28 14:43:43','2019-11-28 19:43:43','<header><span class=\"submitted\" data-x=\"1574700321\">Creado el Lunes, 25 de Noviembre del 2019 11:45:21 am</span></header>\n<div class=\"field field-name-field-bajada field-type-text-long field-label-hidden\">\n<div class=\"field-items\">\n<div class=\"field-item even\">Las acusan de concertar precios para pagarles muy poco por tonelada de anchoveta</div>\n</div>\n<div>\n<p class=\"rtejustify\">Cientos de pescadores que laboran para los empresarios integrantes de la<strong>Asociacin de Armadores de Embarcaciones Industriales de Madera</strong>realizaron esta maana una movilizacin de protesta en Chimbote para exigir que las empresas pesqueras Exalmar, Hayduk, Copeinca, Austral, Centinela, TASA, entre otras, paguen un precio justo por cada tonelada de anchoveta que compran.</p>\n<p class=\"rtejustify\">Hombres de mar de Chimbote, Lambayeque, La Libertad y Piura participaron de esta protesta en la que portaban carteles con lemas como No a la concertacin de precios, SNP (Sociedad Nacional de Pesquera) no al monopolio.</p>\n<p class=\"rtejustify\">Las embarcaciones de madera, conocidas como Vikingas, son naves de 32 a 110m3 de capacidad de bodega. Estas pescan anchoveta, pero como no pueden procesarla directamente para elaborar harina de pescado, venden su pesca a las grandes empresas pesqueras.</p>\n<p class=\"rtejustify\">Walter Sipion, uno de los armadores presente en la protesta, seal que cuando se dio la ley de cuotas, en el 2008, les pagaban 280 dlares por tonelada de anchoveta, aunque cuando la calidad del recurso capturado no estaba en tan buenas condiciones, ahora que la situacin ha mejorado les pagan 200 y 210 dlares. Consider que un precio justo, ahora que han cado un poco las exportaciones, debera ser 240 dlares por tonelada.</p>\n<p class=\"rtejustify\">El armador agreg que antes las empresas pesqueras, como Tasa, Hayduk, Exalmar y las dems, cuando se iba a abrir la temporada de pesca hacan sus ofertas a las vikingas para comprarles su pesca de anchoveta, de tal modo que entre estas competan y los pescadores salan ganando, pero ahora eso cambi porque al parecer hay un acuerdo de precio entre las pesqueras.</p>\n<p class=\"rtejustify\">Hay una concertacin de la Sociedad (Nacional de Pesquera), acus Sipion, quien seal adems que su sector tiene el 20 % de la cuota de pesca de anchoveta y da ms empleo que las grandes empresas que pescan el 80 %.<strong><em>(EA/M- RSD Noticias)</em></strong></p>\n\n</div>\n</div>','Cientos de pescadores del norte protestan contra las grandes empresas pesqueras','','inherit','closed','closed','','242-autosave-v1','','','2019-11-28 14:43:43','2019-11-28 19:43:43','',242,'http://www.perubroker.com.pe/242-autosave-v1/',0,'revision','',0),(332,1,'2019-11-28 14:44:05','2019-11-28 19:44:05','','[:es]Protesta[:]','','inherit','open','closed','','protesta','','','2019-11-28 14:44:05','2019-11-28 19:44:05','',242,'http://www.perubroker.com.pe/wp-content/uploads/2019/09/Protesta.jpeg',0,'attachment','image/jpeg',0),(333,1,'2019-11-28 14:44:31','2019-11-28 19:44:31','[:es]<header><span class=\"submitted\" data-x=\"1574700321\">Creado el Lunes, 25 de Noviembre del 2019 11:45:21 am</span></header>\r\n<div class=\"field field-name-field-bajada field-type-text-long field-label-hidden\">\r\n<div class=\"field-items\">\r\n<div class=\"field-item even\">Las acusan de concertar precios para pagarles muy poco por tonelada de anchoveta</div>\r\n</div>\r\n<div>\r\n<p class=\"rtejustify\">Cientos de pescadores que laboran para los empresarios integrantes de la<strong>Asociacin de Armadores de Embarcaciones Industriales de Madera</strong>realizaron esta maana una movilizacin de protesta en Chimbote para exigir que las empresas pesqueras Exalmar, Hayduk, Copeinca, Austral, Centinela, TASA, entre otras, paguen un precio justo por cada tonelada de anchoveta que compran.</p>\r\n\r\n<!--more-->\r\n<p class=\"rtejustify\">Hombres de mar de Chimbote, Lambayeque, La Libertad y Piura participaron de esta protesta en la que portaban carteles con lemas como No a la concertacin de precios, SNP (Sociedad Nacional de Pesquera) no al monopolio.</p>\r\n<p class=\"rtejustify\">Las embarcaciones de madera, conocidas como Vikingas, son naves de 32 a 110m3 de capacidad de bodega. Estas pescan anchoveta, pero como no pueden procesarla directamente para elaborar harina de pescado, venden su pesca a las grandes empresas pesqueras.</p>\r\n<p class=\"rtejustify\">Walter Sipion, uno de los armadores presente en la protesta, seal que cuando se dio la ley de cuotas, en el 2008, les pagaban 280 dlares por tonelada de anchoveta, aunque cuando la calidad del recurso capturado no estaba en tan buenas condiciones, ahora que la situacin ha mejorado les pagan 200 y 210 dlares. Consider que un precio justo, ahora que han cado un poco las exportaciones, debera ser 240 dlares por tonelada.</p>\r\n<p class=\"rtejustify\">El armador agreg que antes las empresas pesqueras, como Tasa, Hayduk, Exalmar y las dems, cuando se iba a abrir la temporada de pesca hacan sus ofertas a las vikingas para comprarles su pesca de anchoveta, de tal modo que entre estas competan y los pescadores salan ganando, pero ahora eso cambi porque al parecer hay un acuerdo de precio entre las pesqueras.</p>\r\n<p class=\"rtejustify\">Hay una concertacin de la Sociedad (Nacional de Pesquera), acus Sipion, quien seal adems que su sector tiene el 20 % de la cuota de pesca de anchoveta y da ms empleo que las grandes empresas que pescan el 80 %.<strong><em>(EA/M- RSD Noticias)</em></strong></p>\r\n\r\n</div>\r\n</div>[:]','[:es]Cientos de pescadores del norte protestan contra las grandes empresas pesqueras[:]','','inherit','closed','closed','','242-revision-v1','','','2019-11-28 14:44:31','2019-11-28 19:44:31','',242,'http://www.perubroker.com.pe/242-revision-v1/',0,'revision','',0),(334,1,'2019-12-03 10:14:16','2019-12-03 15:14:16','','[:es]OZ2Z3WIBCVDXFCQN7RPRHZQXVA[:]','','inherit','open','closed','','oz2z3wibcvdxfcqn7rprhzqxva','','','2019-12-03 10:14:16','2019-12-03 15:14:16','',244,'http://www.perubroker.com.pe/wp-content/uploads/2019/09/OZ2Z3WIBCVDXFCQN7RPRHZQXVA.jpg',0,'attachment','image/jpeg',0),(337,1,'2020-05-18 09:49:19','2020-05-18 14:49:19','Nuestra empresa empez su andadura en el mundo de las materias primas en 1949. Por aquel entonces los antiguos propietarios de la empresa realizaban operaciones de compraventa no solo con materias primas propiamente dichas, sino tambin con otros productos transformados.\n<p align=\"justify\">Fue a partir de 1954 cuando se especializaron en el sector pesquero, agrario y de fletamentos.</p>\n<p align=\"justify\">Hoy, Peru Broker, S.A. es una empresa de agenciamiento, representacin e intermediacin en aquellos campos ya indicados arriba, y, gracias a nuestra experiencia y trabajo, podemos confirmar que somos una de las principales casas de representaciones para harina de pescado a nivel mundial.</p>\n<p align=\"justify\">Por nuestro vasto conocimiento de las instituciones as como del empresariado peruano, nuestra actividad no solo llega a las materias primas y a los fletamentos sino tambin a otros sectores en los que contamos con amigos y conocidos</p>','SUMMARY','','inherit','closed','closed','','17-autosave-v1','','','2020-05-18 09:49:19','2020-05-18 14:49:19','',17,'http://www.perubroker.com.pe/17-autosave-v1/',0,'revision','',0),(338,1,'2019-12-10 15:53:37','2019-12-10 20:53:37','Estar alertas y adaptarnos a las nuevas circunstancias en la evolucin de los cambiantes y difciles mercados de las materias primas, siempre teniendo en cuenta que realizamos y cumplimos una funcin de ayuda y servicio tanto a los proveedores como a los clientes, labor que venimos realizando desde los inicios de PERU BROKER SA, ahorrando el tiempo en el proceso de compra y ejecucin, pero tambin evitando el desgaste de una relacin, cuando se presentan problemas.\n\nCabe mencionar que estamos desde ya totalmente involucrados en las nuevas tendencias de consumo humano, como los aceites de alto contenido de cidos grasos Omega-3 y de las harinas especiales, procesadas mediante hidrlisis por fermentacin, de ms alta disponibilidad proteica.','Idea de futuro','','inherit','closed','closed','','20-autosave-v1','','','2019-12-10 15:53:37','2019-12-10 20:53:37','',20,'http://www.perubroker.com.pe/20-autosave-v1/',0,'revision','',0),(339,1,'2019-12-10 16:44:10','2019-12-10 21:44:10','PERU BROKER se fundo y constituyo en lima, Per, en febrero del ao 1981, habiendo estado los accionistas y directivos relacionados con el comercio internacional de materias primas desde 1954.\n\nHoy actuamos como agentes representantes de compaas extranjeras y como comisionistas, para una diversa gama de productos. Adems, hemos desarrollado a lo largo de los aos, un departamento gil y eficaz de shipping o agente de fletamentos, que facilita y economiza los embarques de nuestros proveedores y clientes.\n\nContamos con socios estratgicos en Europa, que cuentan con la misma experiencia adems de un amplsimo nmero, a nivel global de clientes y proveedores; antiguos y nuevos, pero todos ellos de solvencia.\n\nEsta asociacin estratgica con otra empresa europea de gran reconocimiento en el sector, Hispatrade SA, nos permite, por la diferencia de husos horarios, cubrir de manera adecuada y casi 24 horas diarias, los requerimientos de nuestros clientes asiticos y los de otros continentes.\n\nEn PERU BROKER S.A. estamos muy al corriente de los requerimientos nutricionales y de las ventajas que proporciona la anchoveta peruana (Engraulis Ringens) frente a otras especies, en la fabricacin de piensos para la acuacultura, lechones y otras especies.\n\nNo perdemos de vista la responsabilidad biolgica y medio ambiental en la fabricacin de harina y aceite aunque hay que decir que Per durante los ltimos aos ha sido un referente mundial en estos aspectos','Historia','','inherit','closed','closed','','18-autosave-v1','','','2019-12-10 16:44:10','2019-12-10 21:44:10','',18,'http://www.perubroker.com.pe/18-autosave-v1/',0,'revision','',0),(340,1,'2020-05-18 09:56:38','2020-05-18 14:56:38','<span lang=\"EN-US\"> Assisting customers and suppliers, providing them with unbiased, fact-based information, stressed by the circumstances and factors that are influencing the market in real time.</span><u></u><u></u>\n\n<span lang=\"EN-US\"> Serving buyers interested in purchasing raw materials, obtaining the best available prices from first-class suppliers, large or small, but of proven seriousness and performance.</span><u></u><u></u>\n\n<span lang=\"EN-US\"> Serving clients and suppliers by displaying a highly professionalized work and activity on the execution of contracts; focusing on the speed, accuracy, communication and our selfconfidence to solve problems which may eventually arise (fortunately not the rule but which may occur).</span><u></u><u></u>\n\n<span lang=\"EN-US\">In summary:<b>Serve</b>,<b>be useful</b>and<b>assist,</b>with the best of wills and expertise, to both buyers and sellers, endeavouring always to keep them both equally satisfied. This our final objective.</span>','Objetivos','','inherit','closed','closed','','19-autosave-v1','','','2020-05-18 09:56:38','2020-05-18 14:56:38','',19,'http://www.perubroker.com.pe/19-autosave-v1/',0,'revision','',0),(341,2,'2020-03-06 11:27:45','2020-03-06 16:27:45','Nuestra empresa empez su andadura en el mundo de las materias primas en 1949. En aquella poca los antiguos propietarios de la empresa realizaban operaciones de compraventa no slo con materias primas propiamente dichas sino tambin con productos transformados.\n<p align=\"justify\">Fue a partir de 1954 cuando lleg la especializacin en los sectores pesquero, agrario y de fletamentos.</p>\n<p align=\"justify\">Hoy, Peru Broker S.A. es una empresa de agenciamiento, representacin e intermediacin en los campos indicados anteriormente, y, gracias a nuestra experiencia y trabajo, podemos confirmar que somos una de las principales casas de corretaje para harina y aceite de pescado a nivel mundial.</p>\n<p align=\"justify\">Por nuestro conocimiento de las instituciones as como del empresariado peruano, nuestra actividad se despliega no solo a los rubros antes sealados, sino tambin a otros campos en los que contamos con buenos apoyos.</p>','Resumen','','inherit','closed','closed','','17-autosave-v1','','','2020-03-06 11:27:45','2020-03-06 16:27:45','',17,'http://www.perubroker.com.pe/17-autosave-v1/',0,'revision','',0),(342,2,'2020-03-06 11:18:34','2020-03-06 16:18:34','PERU BROKER se fundo y constituyo en Lima, Per, en febrero del ao 1981, habiendo estado los accionistas y directivos relacionados con el comercio internacional de materias primas desde 1954.\n\nHoy en da actuamos como agentes representantes de un gran numero de compaas extranjeras y como comisionistas para una diversa gama de productos. Adems, hemos desarrollado a lo largo de los aos, un departamento gil y eficaz de shipping o agencia de fletamentos, facilitando as el proceso de ejecucin de embarques a nuestros principales clientes, ayudando con ello a reducir los costos de sobreestada que eventualmente pudieran surgir.\n\nIgualmente contamos con socios estratgicos en Europa, que cuentan con la misma experiencia a nivel global, manteniendo en cartera, clientes y proveedores tradicionales, as como nuevos, todos ellos de gran solvencia, envergadura y seriedad.\n\nEsta asociacin estratgica con otra empresa europea de gran reconocimiento y prestigio en el sector, Hispatrade S.A. Madrid, Espaa, nos permite, por la diferencia de husos horarios el poder cubrir de manera adecuada y casi ininterrumpida dem necesidad o requerimiento de nuestros clientes en otros continentes.\n\nEn Per Broker S.A. somos conocedores de los requerimientos nutricionales y de las ventajas que proporciona el recurso peruano, principalmente la anchoveta peruana (Engraulis ringens) frente a otras especies para la fabricacin de piensos para la acuicultura, lechones y otras especies; todo ello sin olvidar el aspecto medioambiental en la fabricacin de harina y aceite, siendo Per un referente mundial durante los ltimos aos.','Historia','','inherit','closed','closed','','18-autosave-v1','','','2020-03-06 11:18:34','2020-03-06 16:18:34','',18,'http://www.perubroker.com.pe/18-autosave-v1/',0,'revision','',0),(343,2,'2020-03-05 14:47:23','2020-03-05 19:47:23','Estar en todo momento alerta y adaptarnos a las nuevas circunstancias y evolucin de los cambiantes mercados de las materias primas, teniendo en cuenta su dificultad y cumpliendo con nuestra funcin principal de apoyo y servicio tanto a proveedores como a clientes, labor que llevamos marcada desde los inicios de PERU BROKER SA, ahorrando tiempo en el proceso de compra y ejecucin, pero de igual manera evitando el desgaste de una relacin cuando puedan surgir eventuales problemas.\n\nCabe mencionar que estamos desde ya totalmente involucrados e integrados en las nuevas tendencias del consumo humano, tanto en los aceites de alto contenido de cidos grasos Omega-3, Omega-6, como en las harinas especiales procesadas mediante hidrlisis por fermentacin o digestin enzimtica, de ms alta disponibilidad proteica.','Idea de futuro','','inherit','closed','closed','','20-autosave-v1','','','2020-03-05 14:47:23','2020-03-05 19:47:23','',20,'http://www.perubroker.com.pe/20-autosave-v1/',0,'revision','',0),(344,2,'2020-01-16 10:44:38','2020-01-16 15:44:38','Desde Per, Ecuador, Chile, Panam y Mxico a los pases del Este de Asia y Europa, principalmente y ocasionalmente a pases de frica y Oriente medio.\n\nHacemos las reservas de espacio de naves en las condiciones ms competitivas, para carga de importacin y exportac